import Link from "next/link";
function App({ Component, pageProps }) {
  return (
    <>
      <h1>HEllo</h1>
      {/* <div>
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/about">
          <a>About</a>{" "}
        </Link>
        <Link href="/contact">
          <a>Contact</a>{" "}
        </Link>
      </div> */}
      <ul>
        <li>
          <Link href="/">
            <a>Home</a>
          </Link>
        </li>
        <li>
          <Link href="/about">
            <a>About Us</a>
          </Link>
        </li>
      </ul>

      <Component {...pageProps} />
    </>
  );
}

export default App;
